import React from 'react'
import './App.scss';
export default function App() {
  return (
    <Router>
      <Search/>
      <Switch>
        <Route exact path={"/"} component={App}/>
        <Route path={"/search"} component={Results}/>
        <Route path={"/local"} component={Local}/>
        <Route path={"/create-local"} component={newLocal}/>
      </Switch>
    </Router>
  )
}
